import React from 'react';
import "./_sectionto.scss";

const Sectionto = () => {
    return (
        <>
            <section className="sectionto container">
                <div className="sectionto_elements">
                    <button className="button-to sectionto_1"><h1>WYPRAWY</h1></button>
                    <button className="button-to sectionto_2">MAPA</button>
                    <button className="button-to sectionto_3">WYDARZENIA</button>
                    <button className="button-to sectionto_4">KONTAKT</button>
                </div>
            </section>
        </>
    );
};

export default Sectionto;
